import React, { Component } from "react";
import axios from "axios";

class Cart extends Component {
    _isMounted = false;
  
    constructor(props) {
      super(props);
      this.state = {
          cart: []
        
      };
  
      this.props = props;
    }
  
    componentDidMount = () => {
      this._isMounted = true;
      this.fetchData(this.props.match.params.category);
  
    };


    fetchData = () => {
        axios
          .get("/api/cart")
          .then((response) => {
            if (this._isMounted) {
              this.setState({
                products: response.data
              });
  
    
              
            }
          })
          .catch((error) => {
            console.log(error);
          });
      };
      
      render() {
          return (
            <div>{this.state.products}</div>
          )
      }
    }

    export default Cart;
